import React from "react";
import { Component } from "react";

const stuff  = [
  {
  name: "NAME",
  rank: 1,
  salary: 101,
  desc: "DESCRIPTION OF JOB WILL PROBABLY TAKE UP A LOT OF SPACE.",
  jobs: ["JOB 1", "JOB 2", "JOB 3"]
  },
  {
  name: "NAME2",
  rank: 2,
  salary: 202,
  desc: "DESCRIPTION OF JOB WILL PROBABLY TAKE UP A LOT OF SPACE.",
  jobs: ["JOB 1", "JOB 2", "JOB 3"]
  },
  {
  name: "NAME3",
  rank: 3,
  salary: 1234,
  desc: "DESCRIPTION OF JOB WILL PROBABLY TAKE UP A LOT OF SPACE.",
  jobs: ["JOB 1", "JOB 2", "JOB 3"]
  }
]

class Job extends Component {

  expand = major => {
    console.log(major)
  }

render(){

let wrap = {
  width: "90vw",
  marginLeft: "auto",
  marginRight: "auto",
  height: "fit-content",
  borderCollapse: "collapse",
  borderColor: "#dcdcdc",

};

    return(
      <div>
      <table border="1" frame="void" rules="rows" style={wrap}>
        <colgroup>
         <col style={{width: "70%", minWidth: "70%"}}/>
         <col style={{width: "10%", minWidth: "10%", textAlign: "center"}}/>
         <col style={{width: "20%", minWidth: "20%"}}/>
        </colgroup>
        <thead style={{background: "white", textAlign: "left", padding: "2vw"}}>
          <th>Major</th>
          <th>Ranking</th>
          <th>Salary</th>
        </thead>
        <tbody>
          {stuff.map(major =>
          <tr id={major.name} className="entry" onClick={() => this.expand(major)}>
           <td style={{color:"#3db6ff", fontWeight:"bold"}}>{major.name}</td>
           <td>{major.rank}</td>
           <td>${major.salary.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")}</td>
          </tr>
          )}
        </tbody>
      </table>
      </div>
    );
}

}

export default Job;
